import focusedCases from "./focusedCases";
import * as style from "../../css/light/focusedList"

export default function AssociatedItem(props) {
  return (
    <div>
      <div style={style.focusTitle}>{props.title}</div>
      <div style={{...style.divider, margin: "3px 0px 2px 36px", width: "29.1vw"}}/>
      <div style={style.focusedAssociatedContainer}>{focusedCases(props.profile[0], props.profile[2], props.profile[0].resources[0].data[props.profile[1]])}</div>
    </div>
  )
}
